import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link } from "react-router-dom";
import "./Login.css";

// Import the useHistory hook from react-router-dom
import { useHistory } from "react-router-dom";

export default function Login() {
  const [activeForm, setActiveForm] = useState("signUp");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmpassword, setconfirmPassword] = useState("");
  // Use the useHistory hook to navigate programmatically
  const history = useHistory();

  async function signUpClick(e) {
    e.preventDefault();
    setActiveForm("signUp");

    try {
      await axios.post("http://localhost:4000/user/save", {
        name: name,
        email: email,
        password: password,
        confirmpassword: password,
      });
    } catch (e) {
      console.log(e);
    }
  }

  async function logInClick(e) {
    e.preventDefault();

    try {
      const res = await axios.post("http://localhost:4000/user/find", {
        email: email,
        password: password,
      });
      if (res.status === 200) {
        // Navigate programmatically after successful login
        history.push("/dashboard");
      }
    } catch (e) {
      console.log(e);
    }
  }

  return (
    <div>
      <div className="container">
        <div id="quizzieBox">
          <h1>Quizzie</h1>

          <div className="slides">
            <div className="slidesHead">
              <div className="inline">
                <button
                  id="signUpButton"
                  onClick={signUpClick}
                  className={activeForm === "signUp" ? "activeButton" : ""}
                >
                  Sign Up
                </button>
              </div>
              <div className="inline">
                <button
                  id="logInButton"
                  onClick={() => setActiveForm("logIn")}
                  className={activeForm === "logIn" ? "activeButton" : ""}
                >
                  Log In
                </button>
              </div>
            </div>

            <div className="slidesBody">
              {activeForm === "logIn" && (
                <div className="logIn inline">
                  <div>
                    <p className="inline emailin">Email</p>
                    <input
                      type="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                    ></input>
                  </div>
                  <div>
                    <p className="inline passin">Password</p>
                    <input
                      type="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                    ></input>
                  </div>
                  <div>
                    {/* Remove the Link component */}
                    <button
                      type="submit"
                      className="blueButton"
                      onClick={(e) => logInClick(e)}
                    >
                      Log In
                    </button>
                  </div>
                </div>
              )}
              {activeForm === "signUp" && (
                <div className="inline signUp">
                  <div>
                    <p className="inline name">Name</p>
                    <input
                      type="name"
                      value={name}
                      onChange={(e) => setName(e.target.value)}
                    ></input>
                  </div>
                  <div>
                    <p className="inline email">Email</p>
                    <input
                      type="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                    ></input>
                  </div>
                  <div>
                    <p className="inline pass">Password</p>
                    <input
                      type="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                    ></input>
                  </div>
                  <div>
                    <p className="inline confpass">Confirm Password</p>
                    <input
                      type="password"
                      value={confirmpassword}
                      onChange={(e) => setconfirmPassword(e.target.value)}
                    ></input>
                  </div>
                  <div>
                    {/* Remove the Link component */}
                    <button
                      type="submit"
                      className="blueButton"
                      onClick={(e) => signUpClick(e)}
                    >
                      Sign Up
                    </button>
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
